Команда X-Sport занимается развитием Экстремального спорта и активного отдыха.

Экстрим с командой профессионалов станет для Вас захватывающим отдыхом.
Вы сможете испытать море ощущений, познакомиться с новыми людьми, хорошо провести время, почувствовать жизнь во всех ее красках!

Сейчас мы активно занимаемся следующими направлениям:
- Прыжки с веревкой;
- Спелестология (катакомбы);
- Трекинг;
- Горные лыжи;
- Фаершоу;
- Спелеология;
- Альпинизм;
- Скалолазание;
- Ледолазание;
- Слэклайн;
- Прыжки на джамперах;
- Многое, многое другое...

Мы гордится своим большим опытом и навыками, что позволяет нам гарантировать Вашу безопасность, и сделать отдых с Нами приятными и удобными для Вас.

Будьте с профессионалами, будьте с Нами!
И экстрим станет для Вас захватывающим отдыхом!
